import React from 'react';
import Booklist from "./components/Booklist";
import { BrowserRouter, Route, Link } from 'react-router-dom';

const App = () => {
  const languages = ['React', 'Anguler', 'Vue'];
  return (
    <BrowserRouter>
      <div>
        <h1>react app</h1>
        <Route
          exact
          path="/"
          render={(props) => <Booklist languages={languages[0]} />}
        />
        <Route
          path="/vue"
          render={(props) => <Booklist languages={languages[2]} />}
        />
        <Route
          path="/angular"
          render={(props) => <Booklist languages={languages[1]} />}
        />
        <Booklist languages={languages[0]} />
        <Booklist languages={languages[1]} />
        <Booklist languages={languages[2]} />
      </div>
    </BrowserRouter>
  );
}

export default App;
